<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>BedWars Late-Game Tournament Application</title>
  <style>
    body {
      font-family: Arial, sans-serif;
      background: #0f0f14;
      color: #e6e6eb;
      display: flex;
      justify-content: center;
      padding: 40px;
    }

    .container {
      width: 100%;
      max-width: 500px;
      background: #171722;
      padding: 25px;
      border-radius: 10px;
      box-shadow: 0 0 15px rgba(0,0,0,0.5);
    }

    h1 {
      text-align: center;
      color: #a88cff;
    }

    label {
      display: block;
      margin-top: 15px;
      font-weight: bold;
    }

    input, select {
      width: 100%;
      padding: 8px;
      margin-top: 5px;
      background: #0f0f14;
      color: #fff;
      border: 1px solid #333;
      border-radius: 5px;
    }

    .rules {
      margin-top: 15px;
      font-size: 14px;
      background: #0f0f14;
      padding: 10px;
      border-radius: 6px;
    }

    button {
      width: 100%;
      margin-top: 20px;
      padding: 10px;
      background: #7b5cff;
      border: none;
      border-radius: 6px;
      color: white;
      font-size: 16px;
      cursor: pointer;
    }

    button:hover {
      background: #6a4be6;
    }

    .status {
      margin-top: 15px;
      text-align: center;
      font-size: 14px;
    }
  </style>
</head>
<body>

<div class="container">
  <h1>Late-Game Tournament Application</h1>

  <label>Roblox Username</label>
  <input id="username" placeholder="Your Roblox username">

  <label>Discord Username*</label>
  <input id="discord" placeholder="user#0000">

  <label>Will you be on by 2 PM EST on 1/17/2026?</label>
  <select id="availability">
    <option value="">Select an option</option>
    <option value="Yes">Yes</option>
    <option value="No">No</option>
  </select>

  <div class="rules">
    <strong>Rules:</strong>
    <ul>
      <li>No closet cheating</li>
      <li>No FFlag abusing</li>
      <li>No bug abusing</li>
      <li>No game manipulation considered cheating</li>
    </ul>
    <p>This tournament is for fun, with little to no prize.</p>
  </div>

  <button onclick="submitApplication()">Submit Application</button>

  <div class="status" id="status"></div>
</div>
